// Import the React and ReactDOM libraries
import React from 'react';
import ReactDOM from 'react-dom';

// Create a react component
const App = () => {


  return (
    <div style={{
      backgroundImage: `url("c.jpg")`,

      position: 'absolute',
      width: '100vw',
      height: '100vh'
      //backgroundImage: "url(${headerImg})"backgroundColor: "#ffe063"
    }}>

      <h1 style={{
        position: "relative",
        top: "100px",
        left: "800px",
        fontFamily: "Brush Script Std, cursive",
        textAlign: "center", color: "#baa7d9"
      }}>Hello, I'm  Kulikova Dariia</h1>
      <a href="https://www.linkedin.com/in/dariia-kulikova-6b48ab172">
        <img style={{
          width: "30px",
          margin: "30px auto"
        }}
          src="Linkedin.png" />
        LinkedIn
      </a>

      <a href="https://github.com/dariiakulik">
        <img style={{
          width: "30px",
          margin: "30px auto"
        }}
          src="github.png" />
        Github
      </a>

      <a href="https://resume.io/r/zeT2qZVHx">
        <img style={{
          width: "30px",
          margin: "30px auto"
        }}
          src="cv.jpeg" />
       CV
      </a>
      <a href="" style={{
        textDecoration: "none",
        color: "white",
        position: "relative",
        top: "-100px",
        left: "800px",
        background: "blue",
        padding: "20px 30px",
        margin: "10px 20px",
        borderRadius: "10px",
        fontFamily: "Montserrat, sans-serif",
        textTransform: "uppercase",
        letterSpacing: "2px",
        backgroundImage: "linear-gradient(to right, #9EEFE1 0%, #4830F0 51%, #9EEFE1 100%)",
        backgroundSize: "200% auto",
        boxShadow: "0 16px 32px 0 rgba(0,40,120,.35);",
        transition: ".5s",
        "&:hover": {
          boxShadow: "0 0 0 0 rgba(0,40,120,0)",
          backgroundPosition: "0 0"
        }
      }}> Work
      </a>





    </div >
  )
}

// Take the react component and show it on the screen
ReactDOM.render(<App />, document.querySelector('#root'));
